// Packages
import { useState } from 'react';

export default function SignUp({ handleSignUp }) {
  const [formData, setFormData] = useState({
    email: '',
    name: '',
    pronouns: '',
    username: '',
    profile_pic_url: '',
    password: ''
  })
  const { email, name, pronouns, username, profile_pic_url, password } = formData;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  return (
    <main>
      <h1>Finstagram</h1>
      <form onSubmit={(e) => {
        e.preventDefault();
        handleSignUp(formData);
      }}>
        <label className='hidden'>
          Email
          <input type='text' name='email' value={email} onChange={handleChange} />
        </label>
        <label className='hidden'>
          Name
          <input type='text' name='name' value={name} onChange={handleChange} />
        </label>
        <label className='hidden'>
          Pronouns
          <input type='text' name='pronouns' value={pronouns} onChange={handleChange} />
        </label>
        <label className='hidden'>
          Username
          <input type='text' name='username' value={username} onChange={handleChange} />
        </label>
        <label className='hidden'>
          Profile Picture URL
          <input type='text' name='profile_pic_url' value={profile_pic_url} onChange={handleChange} />
        </label>
        <label className='hidden'>
          Password
          <input type='password' name='password' value={password} onChange={handleChange} />
        </label>
        <button>Sign Up In</button>
      </form>
    </main>
  )
}
